actions.script:
ACTIONS.OBJECT.CHEST("Generacion1", 0, function () {
                    var pokemons = ["bulbasaur", "squirtle", "charmander"];
                    var buttons = [];
                    for (var pokemon of pokemons) {
                        buttons.push({
                            text: "",
                            image: DOMAINRESOURCE + `resources/poekemon/gif/front/${pokemon}.gif`,
                            click: function () {
                                ACTIONS.PROGRESS.SET(1);
                                ACTIONS.GAME.SAVE(function () {
                                    POKEMOMFIND.ADD(POKEMOMFIND.GENERATE(pokemon,false,true));    
                                });
                            }
                        });
                    }
                    buttons.push({
                        text: LANGUAGE.t("Salir"),
                        click: function () {
                            ACTIONS.MESSAGE.HIDE();
                        }
                    });

                    ACTIONS.MESSAGE.CHOICE("OKey Myles", "Elije uno con mucho cuidado, cada Pokemon tiene un tipo diferente, planta, agua y fuego.", buttons, function () {

                    });
                });

